function basket_add(btn) {
  var basket = document.querySelector('.basket');
  var basket_list = basket.querySelector('.basket__list');
  var elems = basket.querySelectorAll('.basket__el');
  var product = btn.parentNode.parentNode;
  var name = product.querySelector('.title').textContent;
  var img = product.querySelector('img').getAttribute('src');
  var id = product.getAttribute('id');
  var check_add = true;
  elems.forEach(function (el) {
    if (el.dataset.id == id) {
      check_add = false;
    }
  });

  if (check_add) {
    basket_list.insertAdjacentHTML('beforeEnd', "<li class=\"basket__el\" data-id=\"".concat(id, "\">\n\t\t\t\t<div class=\"img\"><img src=\"").concat(img, "\"></div>\n\t\t\t\t<div class=\"basket__box\">\n\t\t\t\t\t<h4 class=\"name\">").concat(name, "</h4>\n\t\t\t\t\t<div class=\"delete\">delete</div>\n\t\t\t\t\t<div class=\"quantity\">quantity: <span class=\"quantity__num\">1</span></div>\n\t\t\t\t</div>\n\t\t\t</li>"));
  } else {
    var el_id = basket.querySelector("li[data-id='".concat(id, "'"));
    var q_value = Number(el_id.querySelector('.quantity__num').textContent);
    el_id.querySelector('.quantity__num').textContent = q_value += 1;
  }

  basket_el_q();
  basket_remove_btn();
}

function basket_el_q() {
  var basket = document.querySelector('.basket');
  var span = basket.querySelector('span');
  var quantity_elms = basket.querySelectorAll('.quantity__num');
  var elems_num = 0;
  quantity_elms.forEach(function (el) {
    elems_num += Number(el.textContent);
  });
  span.textContent = elems_num;

  if (span.textContent == 0) {
    span.style.opacity = 0;
  } else {
    span.style.opacity = 1;
  }
}

basket_el_q();

function basket_remove_btn() {
  var basket = document.querySelector('.basket');
  var btns = basket.querySelectorAll('.delete');
  btns.forEach(function (el) {
    el.onclick = function () {
      var item = el.parentNode.parentNode;
      item.remove();
      basket_el_q();
    };
  });
}

basket_remove_btn();

