function fly_basket(btn) {
  btn.classList.add('_fly');
  var parent = btn.parentNode.parentNode.querySelector('img');
  var clone = parent.cloneNode(true);
  var basket = document.querySelector('.basket');
  var clone_w = parent.offsetWidth;
  var clone_h = parent.offsetHeight;
  var clone_top = parent.getBoundingClientRect().top;
  var clone_left = parent.getBoundingClientRect().left;
  clone.classList.add('_flyImg');
  clone.style.cssText = "\n\t\tleft: ".concat(clone_left, "px;\n\t\ttop: ").concat(clone_top, "px;\n\t\twidth: ").concat(clone_w, "px;\n\t\theight: ").concat(clone_h, "px;\n\t");
  document.body.append(clone);
  var basket_top = basket.getBoundingClientRect().top;
  var basket_left = basket.getBoundingClientRect().left;
  clone.style.cssText = "\n\t\tleft: ".concat(basket_left + 20, "px;\n\t\ttop: ").concat(basket_top, "px;\n\t\twidth: 0px;\n\t\theight: 0px;\n\t\topacity: 0;\n\t");
}

