function click_btn_product() {
  var products = document.querySelectorAll('.products__el');
  var btns = [];
  products.forEach(function (el) {
    var btn = el.querySelector('.product__btn');
    btns.push(btn);
  });
  btns.forEach(function (btn) {
    btn.onclick = function () {
      fly_basket(btn);
      basket_add(btn);
    };
  });
}

click_btn_product();
