var isTouch;

if ("ontouchstart" in window || navigator.msMaxTouchPoints) {
  isTouch = true;
} else {
  isTouch = false;
}

; // проверка на сенсор

function hover_track() {
  if (!isTouch) {
    var track = document.querySelector('.furniture__grid');
    var c_w = window.innerWidth;
    var t_w = track.clientWidth;
    var off_w = t_w - c_w;
    var translate = 0;
    var speed = 7;

    track.onmousemove = function (e) {
      var xx = e.movementX;

      if (xx > 2 && translate < off_w) {
        translate += speed;
        track.style.cssText = "transform: translate3d(".concat(-translate, "px, 0, 0)");
      }

      if (xx < -2 && translate > 0) {
        translate -= speed;
        track.style.cssText = "transform: translate3d(".concat(-translate, "px, 0, 0)");
      }
    };
  }
}

hover_track();
