function menu_list_accordeon() {
  var navs = document.querySelectorAll('.header-menu__box	');
  var nav_wrap = document.querySelectorAll('.header-menu__el');
  navs.forEach(function (el) {
    el.onclick = function (e) {
      var nav_box = el.parentNode;

      if (nav_box.classList.contains('_open')) {
        nav_box.classList.remove('_open');
      } else {
        nav_wrap.forEach(function (item) {
          item.classList.remove('_open');
        });
        nav_box.classList.add('_open');
      }

      if (window.innerWidth < 820) {
        acc_h();
      }
    };
  });

  function acc_h() {
    nav_wrap.forEach(function (item) {
      var drop_menu = item.querySelector('.drop-menu');
      console.log();

      if (item.classList.contains('_open')) {
        if (drop_menu) {
          drop_menu.style.maxHeight = "".concat(drop_menu.scrollHeight * 2, "px");
        }
      }

      if (!item.classList.contains('_open')) {
        if (drop_menu) {
          drop_menu.removeAttribute('style');
        }
      }
    });
  }
}

menu_list_accordeon();

function search() {
  var search_btn = document.querySelector('#search-btn');

  document.onclick = function (e) {
    var search_box = search_btn.parentNode;
    var search_inp = search_btn.nextElementSibling.querySelector("input[type='text']");

    if (e.target == search_btn) {
      search_box.classList.toggle('_active');
    } else if (e.target !== search_inp) {
      search_box.classList.remove('_active');
    }
  };
}

search();

function burger_menu() {
  var btn = document.querySelector('.hamburger');
  var menu = document.querySelector('.header-menu');

  btn.onclick = function () {
    menu.classList.toggle('_active');

    if (menu.classList.contains('_active')) {
      btn.classList.add('_active');
    } else {
      btn.classList.remove('_active');
    }
  };
}

burger_menu();

function header_fix() {
  var header = document.querySelector('.header');

  window.onscroll = function showHeader() {
    if (window.pageYOffset > 200) {
      header.classList.add('header_fixed');
    } else {
      header.classList.remove('header_fixed');
    }
  };
}

