function mainSlider() {
  var slider = new Splide('#main-slider', {
    type: 'loop',
    autoplay: true,
    classes: {
      arrows: 'main-slider-btns',
      prev: 'main-slider-btns__prev',
      next: 'main-slider-btns__next'
    }
  }).mount();
  var slides = [{
    title: 'title_1',
    text: 'text_1',
    price: '1000',
    img: '01',
    url: ''
  }, {
    title: 'title_2',
    text: 'text_2',
    price: '2000',
    img: '02',
    url: ''
  }, {
    title: 'title_3',
    text: 'text_3',
    price: '3000',
    img: '03',
    url: ''
  }];
  var main_slider = document.querySelector('#main-slider');
  var main_slides = main_slider.querySelectorAll('.splide__slide');
  main_slides.forEach(function (el) {
    el.remove();
  });
  slides.forEach(function (el) {
    slider.add("<li class=\"splide__slide\">\n\t\t\t<img src=\"./assets/images/main-slider/".concat(el.img, ".jpg\" />\n\t\t</li>"));
  });
  /*add slider__link*/

  var card_link = document.querySelector('.main-slider__link');
  var title = card_link.querySelector('.title');
  var text = card_link.querySelector('.text');
  var price = card_link.querySelector('.price');
  var slider_index = slider.index;

  function add_link() {
    title.innerHTML = slides[slider_index].title;
    text.innerHTML = slides[slider_index].text;
    price.innerHTML = slides[slider_index].price;
  }

  add_link();
  setInterval(function () {
    if (slider_index !== slider.index) {
      slider_index = slider.index;
      add_link();
    }
  }, 100);
}

mainSlider();
