function modal_slider_f() {
  var slider_modal = new Splide('#modal-slider', {}).mount();
  var modal = document.querySelector('.modal-slider');
  var overlay = modal.querySelector('.modal-slider__overlay');
  var slider = document.querySelector('#modal-slider');
  var list_old = slider.querySelectorAll('.splide__slide');
  var furniture = document.querySelector('.furniture');
  var images = furniture.querySelectorAll('img');
  var btn_remove = modal.querySelector('.remove-modal');
  list_old.forEach(function (el) {
    return el.remove();
  });
  images.forEach(function (el, i) {
    slider_modal.add("<li class=\"splide__slide\">\n\t\t\t<img src=\"".concat(el.getAttribute('src'), "\">\n\t\t</li>"));

    el.parentNode.onclick = function () {
      return modal_open(i);
    };
  });

  btn_remove.onclick = function () {
    return modal_remove();
  };

  overlay.onclick = function () {
    return modal_remove();
  };
  /*_______funcs________*/


  function modal_remove() {
    modal.classList.remove('_active');
  }

  function modal_open(active_index) {
    modal.classList.add('_active');
    slider_modal.index = active_index;
    slider_modal.refresh();
  }
}

modal_slider_f();
