function media(slider) {
  // options;
  var desktop = true;
  var d_slides = 3;
  var laptop = false;
  var l_slides = 2;
  var tablet = false;
  var t_slides = 1;
  var slidesToShow = 0;
  var focus = 'center';
  var mediaDesktop = window.matchMedia('(min-width: 1400px)');
  var mediaLaptop = window.matchMedia('(max-width: 1200px)');
  var mediaTablet = window.matchMedia('(max-width: 820px)');

  if (mediaDesktop.matches) {
    tablet = false;
    laptop = false;
    desktop = true;
  }

  if (mediaLaptop.matches) {
    desktop = false;
    tablet = false;
    laptop = true;
  }

  if (mediaTablet.matches) {
    desktop = false;
    laptop = false;
    tablet = true;
  }

  if (desktop) {
    slidesToShow = d_slides;
    focus = 'center';
  }

  if (laptop) {
    slidesToShow = l_slides;
    focus = 'right';
  }

  if (tablet) {
    slidesToShow = t_slides;
    focus = 'center';
  }

  slider.options = {
    perPage: slidesToShow,
    focus: focus
  };
}
